import React from "react";
import { students } from "./data";
import StudentTableRow from "./StudentTableRow";

const ListStudent = () => {


    return (
        <div>
            <h2>Listar estudante</h2>
            <table className="table table-striped">
                <thead>
                    <th>ID</th>
                    <th>Nome</th>
                    <th>Curso</th>
                    <th>IRA</th>
                    <th colSpan="2"></th>
                </thead>
                <tbody>

                </tbody>
            </table>
        </div>
    )
}

export default ListStudent;
